import React, { useState } from "react";
import "./App.css";
import { FaSun, FaMoon } from "react-icons/fa"; // Importing icons

function App() {
  const [isDarkTheme, setIsDarkTheme] = useState(false);

  const toggleTheme = () => {
    setIsDarkTheme((prevTheme) => !prevTheme);
    document.body.classList.toggle("dark-theme", !isDarkTheme);
  };

  return (
    <div className="App">
      <button className="theme-toggle" onClick={toggleTheme}>
        {isDarkTheme ? <FaSun /> : <FaMoon />}
      </button>
      <div className="profile-content">
        <img
          src="/images/solomon-profile-photo.jpg"
          alt="Solomon Taiwo"
          className="profile-photo"
        />
        <h1>I'm Solomon Taiwo</h1>
        <p>
          Bachelor's Degree in Computer Science at the{" "}
          <a
            href="https://corsi.unife.it/informatica"
            target="_blank"
            rel="noopener noreferrer"
          >
            University of Ferrara
          </a>
          .
          <br /> <br />
          Currently pursuing a Master's Degree in Computer Engineering
          (specialist track in Artificial Intelligence and Data Analysis) at the{" "}
          <a
            href="https://www.polito.it/en/education/master-s-degree-programmes/computer-engineering"
            target="_blank"
            rel="noopener noreferrer"
          >
            Polytechnic University of Turin
          </a>{" "}
          and working as a Software Engineer at{" "}
          <a
            href="https://www.teleconsys.it/"
            target="_blank"
            rel="noopener noreferrer"
          >
            Teleconsys
          </a>
          .
          <br />
          Technologies: C/C++, Python, Java, JavaScript, Ruby, PHP, SQL, Ruby on
          Rails, Vue.js, Quasar, Laravel, and more.
        </p>
        Link to fun project
      </div>
    </div>
  );
}

export default App;
